import { StyledAccessTimeIcon, StyledDivList, StyledNavbar } from './Navbar.styled';
import { Typography } from '@mui/material';

import LocationOnIcon from '@mui/icons-material/LocationOn';
import EventIcon from '@mui/icons-material/Event';
import PhotoLibraryIcon from '@mui/icons-material/PhotoLibrary';

const listItems = [
  { title: 'Timezones', description: 'US & EU', icon: <StyledAccessTimeIcon /> },
  { title: 'Where', description: 'Discord', icon: <LocationOnIcon style={{ color: 'lightgray' }} fontSize="large" /> },
  { title: 'When', description: 'Every Weekend', icon: <EventIcon style={{ color: 'lightgray' }} fontSize="large" /> },
  { title: 'Wanna See?', description: 'Galleria', icon: <PhotoLibraryIcon style={{ color: 'lightgray' }} fontSize="large" /> },
];

export function Navbar() {
  return (
    <StyledNavbar>
      <Typography variant='h1'>W807</Typography>

      {listItems.map((item, index) => (
        <StyledDivList key={index}>
          {item.icon}
          <div>
            <Typography variant='h6'>{item.title.toUpperCase()}</Typography>
            <Typography variant='body1'>{item.description.toUpperCase()}</Typography>
          </div>
        </StyledDivList>
      ))}
    </StyledNavbar>
  );
}
